import "./App.css";
// importing components from react-router-dom package
import {
BrowserRouter as Router,
Routes,
Route,

} from "react-router-dom";

// import Home component
import Transactions from "./Transactions";

function App() {
return (
	<>
	<Router>
		<Routes>
		<Route exact path="/" component={Transactions}></Route>
		</Routes>
	</Router>
	</>
);
}

export default App;
